import React from 'react';
import Sidebar from '../../components/Sidebar';
import { Outlet } from 'react-router-dom';
export const DashboardLayout = ({ children }) => {
  return (
    <div className='w-full flex h-[100vh]'>
      <div className=''>
        <Sidebar />
      </div>
      <div className='main-content'>
        <Outlet />
      </div>
    </div>
  );
};
